import React from 'react';

const Frame130 = () => {
  return (
    <div
      style={{
        width: '1440px',
        minHeight: '560px',
        background: '#D23429',
        padding: '100px 168px 100px 168px',
        display: 'flex',
        flexDirection: 'column',
        gap: '10px',
        boxSizing: 'border-box',
      }}
    >
      {/* Frame130 content goes here */}
      <div style={{ color: '#fff', fontSize: '32px', fontWeight: 600 }}>Frame130 Placeholder</div>
    </div>
  );
};

export default Frame130;
